export default function Menu(prop){
    const nombre=prop.nombre
    if (nombre !==''){
        return(
            <div className="Menu">
                <button>Ingreso</button>
                <button>Egreso</button>
            </div>
        )
    }
    else(
        <div className="Menu">
                <button>Ingreso</button>
                <button>Egreso</button>
            </div>
    )
}
